import React from "react";
import "./SkillsBody.css";

const SkillsBody: React.FC = () => {
  return (
    <div>
      <dl>
        <dt>Coffee</dt>
        <dd>- black hot drink</dd>
        <dt>Milk</dt>
        <dd>- white cold drink</dd>
      </dl>
    </div>
  );
};

export default SkillsBody;
